import React, { useEffect } from "react"
import UserKit from "../data/UserKit"

const CustomerList = () => {
  const userKit = new UserKit()
  useEffect(() => {
    userKit.getCustomers()
  }, [])
  return <div>I am list</div>
}

export default CustomerList
